function Card() {
    return (
        <>
            <p><i className=" bi bi-alarm-fill text-warning"></i></p>
            <p>FP</p>
            <p>Access Volcanic</p>
            <p>Please reviews your website</p>
            <p>Your website will go live soon, please do review your site and leave comments on pastel
                before "Date". Please inform your OC once you've finished action.
            </p>
            <a href="#"><button>Review your website</button></a>
        </>
    )
}

export default Card;
